function NavBar() {
    return (
        <div className="nav">
            <div className="logo">
                Card Shop, LLC
            </div>
            <ul>
                <li>Home</li>
                <li>About Us</li>
                <li>Login</li>
            </ul>
        </div>
    )
}

export default NavBar;
